import React from 'react';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import { faGithub, faLinkedin, faInstagram } from '@fortawesome/free-brands-svg-icons';
import Photo from "./image/photo.jpg";

import styled from "styled-components";

const Container = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
  font-size: 15px;
  color: #282828;
`;
const Header = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: flex-start;
  margin-top: 100px;
`;
const SubHeader = styled.div`
  font-size: 30px;
  color: #707070;
`;
const Icon = styled.img`
  width: 150px;
  border-radius: 100px;
  margin-right: 50px;
`;
const Info = styled.div`
  font-size: 25px;
  color: #707070;
`;
const Name = styled.div`
  font-size: 45px;
  font-weight: 600;
  color: #282828;
`;
const Content = styled.div`

`;
const About = styled.div`

`;
const Experience = styled.div`

`;
const Company = styled.div`

`;
const Role = styled.div`

`;
const Duration = styled.div`

`;
const Description = styled.div`

`;
const Project = styled.div`

`;
const Skill = styled.div`

`;


function App() {
  return (
    <Container>
      <Header>
        <div>
          <Icon src={Photo}/>
        </div>
        <Info>
          <Name>Lee Kwanyoung</Name>
          <div>Final year student at the University of Hong Kong</div>
          <FontAwesomeIcon icon={faGithub} />
          <FontAwesomeIcon icon={faLinkedin} />
          <FontAwesomeIcon icon={faEnvelope} />
        </Info>
      </Header>
      <Content>
        <About>
          <SubHeader>About</SubHeader>
          I'm a motivated full-stack engineer who has experience building and scaling web applications and services in various domains.

          I'm also passionate about open source contributions, working in high impact environments with frequent deployments, and helping growing development teams build great products.
        </About>
        <Experience>
          <SubHeader>Experience</SubHeader>
          <div>
            <Company></Company>
            <Role></Role>
            <Duration></Duration>
            <Description></Description>
          </div>
        </Experience>
        <Project>
          <SubHeader>Projects</SubHeader>
        </Project>
        <Skill>
          <SubHeader>Skills</SubHeader>
        </Skill>
      </Content>
    </Container>
  );
}

export default App;
